	add("knothole", "{\"term\":\"knothole\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|knot|hole|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In a piece of lumber, a void left by a knot in the wood; such holes are often convenient for peering through when they occur in fences\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1893:\u0027\u0027 Ambrose Bierce, \u0027Can Such Things Be\u0027 [http://etext.virginia.edu/etcbin/ot2www-pubeng?specfile\u003d/texts/english/modeng/publicsearch/modengpub.o2w\u0026amp;act\u003dsurround\u0026amp;offset\u003d94501230\u0026amp;tag\u003dBierce,+Ambrose:+Can+Such+Things+Be,+1893\u0026amp;query\u003d+knothole\u0026amp;id\u003dBieCans\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Looking in the same direction, I saw that the \u0027\u0027knothole\u0027\u0027 in the wall had indeed become a human eye -- a full, black eye, that glared into my own with an entire lack of expression more awful than the most devilish glitter\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1915:\u0027\u0027 Zane Grey, \u0027The Redheaded Outfield\u0027 [http://etext.virginia.edu/etcbin/ot2www-pubeng?specfile\u003d/texts/english/modeng/publicsearch/modengpub.o2w\u0026amp;act\u003dtext\u0026amp;offset\u003d329695594\u0026amp;textreg\u003d1\u0026amp;query\u003dknothole\u0026amp;id\u003dGreRedh\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Red Gilbat was nutty....When the gong rang at the ball grounds there were ten chances to one that Red would not be present. He had been discovered with small boys peeping through \u0027\u0027knotholes\u0027\u0027 at the vacant left field he was supposed to inhabit during play\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Youth league baseball\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1976:\u0027\u0027 w:Pete Pete Rose [//books.google.com/books?id\u003dVMhtAAAAMAAJ\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"But he was worried that a coach of a \u0027\u0027knothole\u0027\u0027 team might not like the idea and not let me switch-hit. So, my dad went to the coach\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1993:\u0027\u0027 w:Rob Rob Portman [//books.google.com/books?id\u003dEB8DAAAAMBAJ\u0026amp;pg\u003dPA32\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"I was a Cub Scout. I went to church with my family, and taught Sunday school when I was in my teens. I played \u0027\u0027knothole\u0027\u0027 baseball and rooted for the w:Cincinnati Reds\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1998:\u0027\u0027 Lonnie Wheeler, \u0027w:Cincinnati Cincinnati Magazine\u0027 [//books.google.com/books?id\u003dhOsCAAAAMBAJ\u0026amp;pg\u003dPA151\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Poetically enough, the w:New Richmond, New Richmond \u0027\u0027knothole\u0027\u0027 field is situated right next to the low, open land between the old and new highway\", \"priority\":12}]}, \"synonyms\":{}}");

