	add("knout", "{\"term\":\"knout\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"old norse\", \"old russian\", \"Russian\"], \"text\":\"Via French from Russian \u0027кнут\u0027 from Old russian \u0027кнутъ\u0027 from Old norse \u0027knútr\u0027 (knot in a cord)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A leather scourge (multi-tail whip), in the severe version known as \u0027great knout\u0027 with metal weights on each tongue, notoriously used in imperial Russia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027: Spray and then slogging \u0027\u0027knouts\u0027\u0027 of water hit the windows or lights like snarling disaffected at a mansion of the rich and frivolous. — Anthony Burgess, \u0027Earthly Powers\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027: The lieutenant gave him twenty strokes of the \u0027\u0027knout\u0027\u0027 and stuck him in a cage for a few days till the snow was ankle deep. — James Meek, \u0027The People\u0027s Act of Love\u0027 (Canongate 2006, p. 193\", \"priority\":3}]}, \"synonyms\":{}}");

